DROP TABLE PTStupciVR;
CREATE TABLE PTStupciVR
    (
        ID INT NOT NULL,
        Firma INT NOT NULL,
        VozniRedID INT NOT NULL,
        VarijantaVRID INT NOT NULL REFERENCES PTVarijanteVR(ID),
        ZapSt VARCHAR(8) NOT NULL,
        SmerVoznje VARCHAR(5),
        DneviVoznjeID INT,
        PrevoznikID INT,
        VrstaPrevoza INT,
        VrstaBusa INT,
        NacinPrevoza INT,
        VrstaPosadeID INT,
        VremeOdhoda FLOAT(53),
        OE INT,
        VeljaOd DATETIME,
        VeljaDo DATETIME,
        StatusERR INT,
        DOSID INT,
        PRIMARY KEY(ID)
    ) ;
CREATE INDEX IX_PTStupciVRFirma ON PTStupciVR (Firma);
CREATE INDEX IX_PTStupciVRStatusERR ON PTStupciVR (VozniRedID, StatusERR);
CREATE INDEX IX_PTStupciVRZapSt ON PTStupciVR (VozniRedID, VarijantaVRID, ZapSt);
